import React from "react";
import { useNavigate } from "react-router-dom";
import '../../GeneralStyle.css'
import '../../fonts/helvetica/HelveticaNeue.ttf'
import search from '../../image/search.svg'
import person from '../../image/person.svg'
import shopping from '../../image/shopping.svg'
// import logo from "../../image/logo.svg"

const Navbar: React.FC = () => {
  const navigate: any = useNavigate();
  
  return (
    <div>
      <div>
      <ul className="nav-bar-container">
        {/* <img src={logo} alt="" /> */}
      <button onClick={() => navigate("/")}><h1>EPICURE</h1></button>
      <button onClick={() => navigate("/restaurant")}>Restaurant</button>
      <button onClick={() => navigate("/chefs")}>Chefs</button>
    </ul>
    </div>
    <div>
      <button><img src={search} alt="" /></button>
      <button><img src={person} alt="" /></button>
      <button><img src={shopping} alt="" /></button>
    </div>
    </div>
    
  );
};

export default Navbar;
